 @josepcgames6611  Printei, agora vou dar queixa. Parabéns. Além de não ter argumento chama os outros de mulambo, não sei se vc sabe disso mas esse termo "mulambo" é um insulto.
Mulambo, ou molambo, significa farrapo, e é um termo de origem angolana. Mulambo surgiu inicialmente com os escravos, na época da escravatura, e depois começou a ser usado com um sentido pejorativo, para designar uma pessoa suja, mal arrumada. Ou seja, vc pode ser preso, vou dar queixa a respeito.
140 - Injuriar alguém, ofendendo-lhe a dignidade ou o decoro: Pena - detenção, de um a seis meses, ou multa.

